export function Initialize() {
	SetDirectMode();

	device.set_endpoint(1, 0x0001, 0xff00); // System IF

	if(savedDpi1 != dpi1 && DpiControl) {
		setDpi(dpi1);

	}
}

function setDpi(dpi) {
	device.set_endpoint(1, 0x0001, 0xff00); // System IF
	savedDpi1 = dpi1;

	let packet = [];
	packet[0] = 0x10;
	packet[1] = 0xFF;
	packet[2] = 0x0A;
	packet[3] = 0x3A;
	packet[4] = 0x00;
	packet[5] = Math.floor(dpi/256);
	packet[6] = dpi%256;
	device.write(packet, 7);
}

